import { Component, ViewChild, ElementRef } from '@angular/core';
import { PedidoModel } from '../../pedidos/pedido/pedidoModel';
import { Router } from '@angular/router';
import { Cliente } from '../../clientes/cliente-component/clienteModel';
import { Item } from '../../pedidos/pedido/itemModel';
import { UtilServices } from '../../util-services';
import { jsPDF } from 'jspdf'
import { autoTable } from 'jspdf-autotable'



@Component({
  selector: 'app-visualizar',
  standalone: false,
  templateUrl: './visualizar.html',
  styleUrl: './visualizar.scss'
})
export class Visualizar {
  pedido?: PedidoModel;
  cliente?: Cliente;
  items: Item[] = [];


  constructor(private router: Router, private utilService: UtilServices) {
    const navigation = this.router.getCurrentNavigation();
    const state = navigation?.extras?.state as {
      pedido?: PedidoModel;
      cliente?: Cliente;
    };
    this.pedido = state?.pedido;
    this.cliente = state?.cliente;

    if (this.pedido?.items?.length) {
      this.items = this.pedido.items;
    } else {
      this.utilService.mostrarMensagem("Lista de itens vazia!");
    }
  }

  gerarPDF() {
    const doc = new jsPDF('p', 'pt', 'a4');
    const marginLeft = 40;
    const marginRight = 40;
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    const data = new Date(this.pedido?.data!);
    const ano = data.getFullYear();

    // üñºÔ∏è Logo
    const logoBase64 = 'data:image/jpeg;base64,'; // sua imagem aqui

    // üßæ Cabe√ßalho
const header = () => {
  doc.setFontSize(14);
  doc.setTextColor(40);
  doc.setFont('helvetica', 'bold');

  // üñºÔ∏è Logo no canto superior esquerdo
  doc.addImage(logoBase64, 'PNG', marginLeft, 20, 50, 20); // x, y, largura, altura

  // T√≠tulo centralizado
  doc.text(`Proposta Comercial - ${this.pedido?.id} ${ano}`, pageWidth / 2, 40, { align: 'center' });

  // Linha divis√≥ria
  doc.line(marginLeft, 50, pageWidth - marginRight, 50);
};


    // üìÑ Informa√ß√µes do cliente
    const clienteInfo = () => {
      doc.setFontSize(9);
      doc.setTextColor(60);
      const startY = 60;
      const lineHeight = 12;
      const cliente = this.cliente ?? {};
      const maxWidth = 180;
      let currentY = startY;

      const info = [
        `Nome: ${cliente.nome ?? ''}`,
        `CNPJ: ${cliente.cnpj ?? ''}`,
        `UF: ${cliente.uf ?? ''}`,
        `Munic√≠pio: ${cliente.municipio ?? ''}`,
        `Endere√ßo: ${cliente.endereco ?? ''}`,
        `Representante Comercial: Jos√© Ant√¥nio Pires Sequeira`
      ];

      info.forEach((line) => {
        doc.text(line, marginLeft, currentY);
        currentY += lineHeight;
      });

      const obsText = `Observa√ß√µes: ${cliente.obs ?? ''}`;
      const obsLines = doc.splitTextToSize(obsText, maxWidth);
      obsLines.forEach((line: string) => {
        doc.text(line, marginLeft, currentY);
        currentY += lineHeight;
      });

      return currentY + 10;
    };

    // üßæ Rodap√© institucional + numera√ß√£o
    const footer = () => {
      const pageCount = doc.getNumberOfPages();
      const footerY = pageHeight - 80;

      doc.setFontSize(9);
      doc.setFont('helvetica', 'normal');
      doc.setTextColor(50);

      const footerLines = [
        'ATENCIOSAMENTE,',
        'CROSSFOX COM√âRCIO DE CONDUTORES EL√âTRICOS // CNPJ: 08.573.550/0001-01',
        'JOSE ANTONIO P. SEQUEIRA',
        'DEPTO. VENDAS',
        'FONE/FAX: (11) 2902-1070 RAMAL 1089 / (12) 99730-4346',
        'e-mail: jose.antonio@crossfoxeletrica.com.br'
      ];

      let currentY = footerY;
      footerLines.forEach((line) => {
        doc.text(line, marginLeft, currentY);
        currentY += 12;
      });

      doc.setFontSize(9);
      doc.setFont('helvetica', 'italic');
      doc.text(`P√°gina ${pageCount}`, pageWidth - marginRight, pageHeight - 20, { align: 'right' });
    };

    const safe = (value: string | number | undefined, fallback = '') => value ?? fallback;
    const formatCurrency = (value: number | undefined) =>
      (value ?? 0).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' });

    // üîπ Gera√ß√£o
    header();
    const startTabelaY = clienteInfo();

    autoTable(doc, {
      startY: startTabelaY,
      head: [['Item', 'Nome', 'Qtd', 'Valor Unit√°rio', 'Valor Total', 'Observa√ß√µes']],
      body: this.items.map((item, index) => [
        index + 1,
        safe(item.nome),
        safe(item.quantidade),
        formatCurrency(item.prcf),
        formatCurrency(item.vtot),
        safe(item.obs)
      ]),
      didDrawPage: () => {
        header();
        footer();
      },
      margin: { top: 60, bottom: 80, left: marginLeft, right: marginRight },
      styles: {
        fontSize: 10,
        cellPadding: 4
      },
      headStyles: {
        fillColor: [240, 240, 240],
        textColor: [0, 0, 0],
        fontStyle: 'normal'
      }
    });

    // üí∞ Valor total
    const finalY = (doc as any).lastAutoTable.finalY + 20;

    doc.setFont('helvetica', 'bold');
    doc.setFontSize(11);
    doc.text('Valor Total do Pedido:', pageWidth - marginRight, finalY, { align: 'right' });

    doc.setFont('helvetica', 'normal');
    doc.text(formatCurrency(this.pedido?.valorTotal), pageWidth - marginRight, finalY + 15, { align: 'right' });

    // üß© TABELA DE TRIBUTA√á√ïES ‚Äî AJUSTADA PARA N√ÉO ENCAVALAR
    const footerData = [
      ['ICMS', `${this.pedido?.icms ?? 0}%`, 'DIFAL/ST', `${this.pedido?.st ?? 0}%`],
      ['IPI', `${this.pedido?.ipi ?? 0}%`, 'PIS', `${this.pedido?.pis ?? 0}%`],
      ['COFINS', `${this.pedido?.cofins ?? 0}%`, 'Validade', `${this.pedido?.observacoes ?? '30 dias'}`],
      ['Prazo de entrega', `${this.pedido?.condicaoFrete ?? 'A combinar'}`,]
    ];

    autoTable(doc, {
      startY: pageHeight - 200, // ‚¨ÖÔ∏è Subido para evitar sobreposi√ß√£o com rodap√©
      body: footerData,
      theme: 'grid',
      margin: { left: marginLeft, right: marginRight },
      styles: {
        fontSize: 9,
        cellPadding: 4,
        halign: 'left',
        valign: 'middle',
      },
      columnStyles: {
        0: { fontStyle: 'bold', textColor: [40, 40, 40], cellWidth: 100 },
        1: { textColor: [60, 60, 60] },
        2: { fontStyle: 'bold', textColor: [40, 40, 40], cellWidth: 100 },
        3: { textColor: [60, 60, 60] },
      },
      didDrawPage: () => {
        footer();
      }
    });

    // üíæ Salvar PDF
    const pedidoId = this.pedido?.id ?? 'pedido';
    const clienteNome = this.cliente?.nome ?? 'cliente';
    doc.save(`${pedidoId}_${clienteNome}.pdf`);
  }
}